import React, {Component} from 'react'
import {Link} from 'react-router-dom'
import AuthenticationService from './AuthenticationService.js'
class WelcomeComponent extends Component {
    render() {
        const isUserLoggedIn = AuthenticationService.isUserLoggedIn();
        return (

            <>
                <h1>Welcome To JJLZ!</h1>
                <div className="container">    
                Welcome {this.props.match.params.name}. You can manage your todos {isUserLoggedIn &&<Link to="/watchlist">Watch List</Link>}.
                <br/><br/>
                {!isUserLoggedIn &&<Link className="nav-link text-dark" to="/register">Register</Link>}
                {!isUserLoggedIn &&<Link className="nav-link text-dark" to="/login">Login</Link>}
                </div>       
            </>        
        )        
    }
}
export default WelcomeComponent
